// WorkoutPlan.tsx
import React from 'react';
import { useParams } from 'react-router-dom';
import { Container, Typography } from '@mui/material';

interface Workout {
  name: string;
  reps: number;
  sets: number;
}

interface WorkoutPlanProps {
  workouts: Workout[];
}

const WorkoutPlan: React.FC<WorkoutPlanProps> = ({ workouts }) => {
  const { id } = useParams();

  const selectedWorkout = workouts.find((workout) => workout.name === `Workout ${id}`);

  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 3 }}>
      {selectedWorkout ? (
        <>
          <Typography variant="h4" color="primary" gutterBottom>
            Workout Plan for {selectedWorkout.name}
          </Typography>
          <Typography variant="h5" color="white" paragraph>
            Reps: {selectedWorkout.reps} | Sets: {selectedWorkout.sets}
          </Typography>
          {/* Add additional workout details as needed */}
        </>
      ) : (
        <Typography variant="h4" color="primary" gutterBottom>
          Workout Not Found
        </Typography>
      )}
    </Container>
  );
};

export default WorkoutPlan;
